import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import {
  Container,
  Paper,
  TextField,
  Button,
  Typography,
  Box,
  Alert,
  Divider,
  CircularProgress,
  Tabs,
  Tab,
  Card,
  CardContent
} from '@mui/material';
import { AdminPanelSettings, EngineeringOutlined } from '@mui/icons-material';
import { useAuth } from '../../contexts/AuthContext';

const StaffLogin = () => {
  const navigate = useNavigate();
  const { login } = useAuth();
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [userType, setUserType] = useState('technical');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleUserTypeChange = (e, newValue) => {
    setUserType(newValue);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      console.log(`Attempting ${userType} login with:`, formData.email);
      const user = await login(formData.email, formData.password);

      if (!user) {
        setError('Login failed. Please check your credentials.');
        setLoading(false);
        return;
      }

      // Check if user role matches selected user type
      if (userType === 'admin' && user.role !== 'admin') {
        setError('This account does not have admin privileges');
        setLoading(false);
        return;
      } else if (userType === 'technical' && user.role !== 'technical') {
        setError('This account does not have technical staff privileges');
        setLoading(false);
        return;
      }

      // Check if user is a client trying to access staff login
      if (user.role === 'client') {
        setError('Client accounts should use the client login page');
        setLoading(false);
        return;
      }

      // Redirect based on user role
      if (user.role === 'admin') {
        navigate('/admin');
      } else if (user.role === 'technical') {
        navigate('/technical');
      }

    } catch (error) {
      console.error('Login error:', error.response?.data || error.message);
      setError(error.response?.data?.message || 'Failed to log in. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const getUserTypeInfo = () => {
    switch(userType) {
      case 'admin':
        return {
          icon: <AdminPanelSettings fontSize="large" sx={{ mb: 2, color: 'error.main' }} />,
          title: 'Administrator Login',
          description: 'Access the admin dashboard to manage users, tickets, and system settings.',
          placeholder: 'admin@beta-tech.com'
        };
      case 'technical':
        return {
          icon: <EngineeringOutlined fontSize="large" sx={{ mb: 2, color: 'info.main' }} />,
          title: 'Technical Staff Login',
          description: 'Access your assigned tickets and provide technical support to clients.',
          placeholder: 'tech@example.com'
        };
      default:
        return {
          icon: <EngineeringOutlined fontSize="large" sx={{ mb: 2 }} />,
          title: 'Staff Login',
          description: 'Access the staff portal',
          placeholder: 'staff@beta-tech.com'
        };
    }
  };

  const userTypeInfo = getUserTypeInfo();

  return (
    <Container maxWidth="sm" sx={{ pt: 8 }}>
      <Paper elevation={3} sx={{ p: 0, display: 'flex', flexDirection: 'column', overflow: 'hidden' }}>
        <Tabs
          value={userType}
          onChange={handleUserTypeChange}
          variant="fullWidth"
          textColor="primary"
          indicatorColor="primary"
          aria-label="user type tabs"
        >
          <Tab 
            icon={<EngineeringOutlined />} 
            label="Technical Staff" 
            value="technical"
            sx={{ py: 2 }}
          />
          <Tab 
            icon={<AdminPanelSettings />} 
            label="Administrator" 
            value="admin"
            sx={{ py: 2 }}
          />
        </Tabs>

        <Box sx={{ p: 4 }}>
          <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', mb: 3 }}>
            {userTypeInfo.icon}
            <Typography variant="h5" component="h1" gutterBottom>
              {userTypeInfo.title}
            </Typography>
            <Typography variant="body2" color="text.secondary" align="center" sx={{ maxWidth: 400 }}>
              {userTypeInfo.description}
            </Typography>
          </Box>

          {error && <Alert severity="error" sx={{ width: '100%', mb: 3 }}>{error}</Alert>}

          <Box component="form" onSubmit={handleSubmit} sx={{ width: '100%' }}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
              value={formData.email}
              onChange={handleChange}
              placeholder={userTypeInfo.placeholder}
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
              value={formData.password}
              onChange={handleChange}
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
              disabled={loading}
              color={userType === 'admin' ? 'error' : 'primary'}
            >
              {loading ? <CircularProgress size={24} /> : 'Sign In'}
            </Button>

            <Divider sx={{ my: 3 }}>
              <Typography variant="caption" color="text.secondary">
                Are you a client?
              </Typography>
            </Divider>

            <Box sx={{ textAlign: 'center' }}>
              <Button 
                variant="outlined" 
                size="medium"
                onClick={() => navigate('/auth/login')}
              >
                Go to Client Login
              </Button>
            </Box>

            {process.env.NODE_ENV === 'development' && (
              <Box sx={{ mt: 3, textAlign: 'center' }}>
                <Divider sx={{ my: 2 }}>
                  <Typography variant="caption" color="text.secondary">
                    Development Only
                  </Typography>
                </Divider>
                <Link to="/auth/login-bypass" style={{ textDecoration: 'none' }}>
                  <Button size="small" color="secondary">
                    Bypass Login (Dev)
                  </Button>
                </Link>

                <Box sx={{ mt: 2, display: 'flex', gap: 2 }}>
                  <Card variant="outlined" sx={{ flex: 1, textAlign: 'left' }}>
                    <CardContent>
                      <Typography variant="subtitle2" color="error">
                        Admin Account
                      </Typography>
                      <Typography variant="caption" display="block" gutterBottom>
                        Email: admin@beta-tech.com
                      </Typography>
                      <Typography variant="caption" display="block">
                        Password: admin123
                      </Typography>
                    </CardContent>
                  </Card>
                  <Card variant="outlined" sx={{ flex: 1, textAlign: 'left' }}>
                    <CardContent>
                      <Typography variant="subtitle2" color="info.main">
                        Tech Account
                      </Typography>
                      <Typography variant="caption" display="block" gutterBottom>
                        Email: tech@example.com
                      </Typography>
                      <Typography variant="caption" display="block">
                        Password: 123456
                      </Typography>
                    </CardContent>
                  </Card>
                </Box>
              </Box>
            )}
          </Box>
        </Box>
      </Paper>
    </Container>
  );
};

export default StaffLogin;
